İnsan kendisine hakaret eden bir insanla bırakın cinsel ilişkide bulunmayı, yan yana bile gelmek istemez. Bu istememe durumu da anormal değil yani. Yardım alınması gereken iki konu var; 
1. Ağrılı cinsel ilişkiden korkmak nedeniyle ilişkiye girememek, yani vajinismus.
2. Eşinizle aranızda üslup sorunu var, yani iletişimde sıkıntı var. Eşiniz kabul ederse evlilik terapisi almanızı öneriyorum. Bir terapistin kapısını çalarsanız size yardım edecektir.
